import React, { Fragment, useState } from 'react';
import Sheet from 'react-modal-sheet';



const SheetHelperPaneUploadCourseContent = ({ isOpen }) => {

    return (
        <Fragment>
            <Sheet isOpen={isOpen} onClose={() => setIsOpen(false)}>
                <Sheet.Container>
                <Sheet.Header />
                <Sheet.Content>{/* Your sheet content goes here */}</Sheet.Content>
                </Sheet.Container>

                <Sheet.Backdrop />
            </Sheet>
        </Fragment>
    );
}
export default SheetHelperPaneUploadCourseContent;
